import React from "react";

const Dashboard =()=>{
    logOut=()=>{
          localStorage.removeItem("token");
        }
    return(
        <>
        <h1>Dashboard</h1> <button onClick={logOut}>logout</button>
        </>
    )
}
export default Dashboard;
